window.bookSummaryJSON = "With millions of copies of his Redwall series in print, Brian Jacques is one of the most popular authors in the world. A <i>New York Times</i> best seller, <i>Mariel of Redwall</i> serves up generous helpings of everything Jacques' countless fans love: rousing escapades, mouthwatering feats, and endearing characters from deep in the woods of Mossflower country. <p> Mousemaid Mariel and her bellmaker father are besieged and tossed into the sea by vicious pirate rat Gabool and his thugs. Washed ashore, Mariel is taken in by the kind animals of Redwall Abbey. But Mariel cannot find her father and is certain he has lost his life. With a motley band of adventurers, she swears revenge and begins a perilous quest straight into the heart of Gabool's stronghold, where a few surprises await.</p> <p> Longtime fans of the world Mossflower will find everything they love in this exhilarating tale, while newcomers will have no trouble jumping straight in and getting lost in a magical, marvelous world.</p>"; 
